import Form from "./Form";
import { useState } from "react";

const App: React.FC = () => {
  const [success, setSuccess] = useState(false);

  if (success) {
    return "senqu";
  }
  return (
    <div className="app-container">
      <Form setSuccess="hello" />
      <img className="img" src={image} alt="img" />
    </div>
  );
};

export default App;
